INSERT INTO `departments` (`id`, `department`, `description`) VALUES
(1, 'Sales', 'Sales department is the direct link between a company\'s product or service and its customers'),
(2, 'Purchasing', 'Purchasing department is a department in order to ensure that all goods, supplies, and inventory needed for the organization to operate are ordered and kept in stock, as well as control inventory levels and costs associated with purchasing the items.'),
(3, 'Inventory', 'Inventory management is the supervision of non-capitalized assets (inventory) and stock items. A component of supply chain management, inventory management supervises the flow of goods from manufacturers to warehouses and from these facilities to point of sale.'),
(4, 'Accounting', 'Part of a company\'s administration that is responsible for preparing the financial statements, maintaining the general ledger, paying bills, billing customers, payroll, cost accounting, financial analysis, and more. The head of the accounting department often has the title of controller.'),
(5, 'human_resource', 'A human resources department is a critical component of employee well-being in any business, no matter how small. HR responsibilities include payroll, benefits, hiring, firing, and keeping up to date with state and federal tax laws.'),
(6, 'Financial', 'Part of company that monitor cash flow');
